import mutations from "./mutations"
import actions from "./actions"
import getters from "./getters"
import createPersistedState from "vuex-persistedstate"

const store = new Vuex.Store({
    // ...
    plugins: [createPersistedState()]
});

export default {
    namespaced: true,
    state() {
        return {
            _id: '',
            token: '',
            firstname: '',
            lastname: '',
            level: '',
            img: '',
            expiresIn: 'sss',
            autoLogout: false
        }
    },
    plugins: [createPersistedState()],
    mutations,
    getters,
    actions
}
